import React from "react";
import ReactDOM from "react-dom";
import css from './index.css';

class Timer extends React.Component {
    render() {
        return(
            <div className="timer">
                <span>00</span>
                <span>:</span>
                <span>00</span>
            </div>
        )
    }
}
